        <input type="text" placeholder="sex" />
        <input type="text" placeholder="want_region" />
        <input type="text" placeholder="want_vol" />
        <input type="text" placeholder="age" />
        <button>Auth/SignUp[Post]</button>
      </div>
    </div>
  );
}
